import React, {use} from 'react'
import {ImageSlider} from './ServiceImg'

export const Images = () => {
    return (
        <div>
           {ImageSlider.map((slide, index) => {
               return <img src={slide.image} alt='image' />
           })}
        </div>
    )
}
